import React from "react";
import Header from "./components/Header";
import Users from "./components/Users";

class App extends React.Component {

  render () {
    return (<div>
              <Header title="list user" />
              <main>
                <Users/>
              </main>
              <aside></aside>
            </div>)
  }
}

export default App;
